('Coldflame Cormaera', '|cFFFFD200Trading Post|r|n', 'During the war of the elemental lords, Cormaera were often used as beasts of burden for the Firelord\'s most loyal lieutenants.', 2524, 424, 192, 11, 1226740, 0, 0, 4, 0, 0, 60822);
